import React, { useState } from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import Stack from "@mui/material/Stack";
import BillerForm from "./BillerForm";

const Transaction = () => {

  return (
    <>
      <Box sx={{ flexGrow: 1 }}>
        <AppBar
          position="sticky"
          sx={{ bgcolor: "#F27C22", border: "2px solid #000000" }}
        >
          <Toolbar>
            <Typography
              variant="h5"
              component="div"
              sx={{ flexGrow: 1, fontWeight: "bold", color: "black" }}
            >
              E-BILLING APP
            </Typography>
            <Typography
              variant="h7"
              component="div"
              sx={{ flexGrow: -10, fontWeight: "bold", color: "black" }}
            >
              PAYBILLS SECTION
            </Typography>
          </Toolbar>
        </AppBar>
      </Box>

      <Stack
        spacing={2}
        direction="row"
        sx={{ paddingLeft: "20%", paddingTop: 10, }}
      >
        <Button
          variant="contained"
          sx={{
            bgcolor: "#F27C22",
            color: "Black",
            border: "2px solid #000000",
          }}
        >
          Back
        </Button>

        <BillerForm
          title="Cignal"
          logoPath="C:\\Users\\GWYNN CUJARDO\\Documents\\GitHub\\e-billing\\src\\Assets\\Cignal.png"
          bankOptions={["Bank of The Philippine Islands", "BDO_Unibank", " China Banking Corporation"]} 
        />
      </Stack>

      {/* Repeat the above Block 10 times with different props */}
    </>
  );
};

export default Transaction;
